script: |
  super -f text -I q11678.spq | sort > q11678.out

inputs:
  - name: q11678.spq
    data: |
      SELECT DISTINCT - col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NULL IN ( + CAST ( + + 61 AS INTEGER ) * + col0 + - + col2 + + - 16, col0 * - col0 );
  - name: tab1

outputs:
  - name: q11678.out
    data: |
